import ReactDOM from 'react-dom/client';

export default function Interests() {

    return (
        <div>

            <h1 className='main-interests'> Interests </h1>
            <p className='interest-par'>Anime. Gaming. Reader. Internet fanatic. Movies. Animals. Food. Music. Traveling.</p>

        </div>
    )
}
